parser = new DOMParser();
xmlDoc = parser.parseFromString(text,"text/xml");
var map;

function checkDate() {
	document.getElementById("results").innerHTML = "No test found on this date"
	document.getElementById("map").innerHTML = ""
	var birthday = document.getElementById("birthday").valueAsDate;
	var year = "Y" + birthday.getFullYear();
	var month = "M" + (birthday.getMonth() + 1); 
	var day = "D" + (birthday.getDate() + 1);
	
	var year = xmlDoc.childNodes[0].querySelector(year);
	
	if (year == null)
		return
		
	var month = year.querySelector(month)
	
	if (month == null)
		return
	
	var date = month.querySelector(day);
	
	if (date == null)
		return;
		
		
	// Where you want to render the map.
	var element = document.getElementById('map');

	// Height has to be set. You can do this in CSS too.
	element.style = 'height:600px;';

	if (map != undefined) { 
		map.off();
		map.remove(); 
	} 
	
	// Create Leaflet map on map element.
	map = L.map(element);

	// Add OSM tile leayer to the Leaflet map.
	L.tileLayer('https://{s}.tile.osm.org/{z}/{x}/{y}.png', {
		attribution: '&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
	}).addTo(map);
	
	myNodelist = date.querySelectorAll("Test")
	console.log(myNodelist.length)
	var i;
	var longitude;
	var latitude;
	var testOutpt = "";
	for (i = 0; i < myNodelist.length; i++) {
		testOutpt = testOutpt + myNodelist[i].getAttribute("Series") + " - " 
		testOutpt = testOutpt + myNodelist[i].getAttribute("Shot") + " - " 
		testOutpt = testOutpt + myNodelist[i].getAttribute("Time")
		testOutpt = testOutpt + "\n"
		longitude = myNodelist[i].getAttribute("Longitude")
		latitude = myNodelist[i].getAttribute("Latitude")
	  	  
		// Target's GPS coordinates.
		var target = L.latLng(latitude, longitude);
		
		// Place a marker on the same location.
		L.marker(target).addTo(map);
	}
	if (i == 1) {
		map.setView(target, 10);
	} else {
		map.setView(target, 2);
	}

	document.getElementById("results").innerHTML = testOutpt
}